import React from 'react';
import Hero from './Hero';
import LeftSection from './LeftSection';
import RightSection from './RightSection';

function ProductPage() {
    return (  
        <>
        <Hero />
        <RightSection/>
        <LeftSection/>
        <Universe/>
        </>
    );
}

export default ProductPage;
